import Phaser from "phaser"
var platform
var player
var keyA
var keyS
var keyD
var keyW
var stars
var score = 0;
var scoreText;
var bombs;
var gameOver;
var reset = false;
var enableGameObject = false;
var showGameObject = false; 
export default class CollectingStarsScene extends Phaser.Scene{
    constructor(){
        super('collecting-stars-scene')
    }
    preload(){
        this.load.image('ground', 'images/platform.png')
        this.load.spritesheet('dude', 'images/dude.png',{frameWidth:32, frameHeight:48})
        this.load.image('sky', 'images/sky.png')
        this.load.image('star', 'images/star.png')
        this.load.image('bomb', 'images/bomb.png')
    }
    create(){
        this.add.image(400,300, 'sky').setScale(4)
        this.platform = this.physics.add.staticGroup()
        this.platform.create(200,400, 'ground')
        this.platform.create(1250,300, 'ground')
        this.platform.create(700,580, 'ground')
        this.platform.create(500,200, 'ground').setScale(0.3)
        this.platform.create(700,200, 'ground').setScale(0.3)
        this.platform.create(900,200, 'ground').setScale(0.3)
        this.platform.create(800,760, 'ground').setScale(4).refreshBody()

        player = this.physics.add.sprite(100,450,'dude')
        player.setCollideWorldBounds(true)
        player.setBounce(0.2)
        this.anims.create({
            key: 'left',
            frames: this.anims.generateFrameNumbers('dude', {start:0, end:3}),
            frameRate:10,
            repeat:-1
        });
        this.anims.create({
            key:'turn',
            frames:[{ key: 'dude', frame:4}],
            frameRate:20
        });
        this.anims.create({
            key: 'right',
            frames: this.anims.generateFrameNumbers('dude',{start:5, end:8}),
            frameRate:10,
            repeat:-1,

        });

        this.physics.add.collider(player, this.platform)

        stars = this.physics.add.group({
            key: 'star',
            repeat: 20,
            setXY:{x:12, y:0, stepX: 70},
        });
        stars.children.iterate(function(child){
            // @ts-ignore
            child.setBounceY(Phaser.Math.FloatBetween(0.4, 0.8));
        })
        this.physics.add.overlap(
            player,
            stars,
            this.collectStar,
            null,
            this
        )


        scoreText = this.add.text(16,16, 'score : 0',{
            fontSize:'30px',
            color:'yellow'
        })
        bombs = this.physics.add.group()
        this.physics.add.collider(bombs, this.platform)
        this.physics.add.collider(
            player,
            bombs,
            this.hitBombs,
            null,
            this
        );
        this.physics.add.collider(stars, this.platform)

    }

    collectStar(player, star){
        this.physics.add.collider(stars, this.platform)
        star.disableBody(true, true)
        score += 10,
        scoreText.setText(' score :' + score)
        var x =(player.x<400)?
        Phaser.Math.Between(400,800) : Phaser.Math.Between(0, 400)
        var bomb = bombs.create(x,0,'bomb')
        bomb.setBounce(1)
        bomb.setCollideWorldBounds(true)
        bomb.setVelocity(
            Phaser.Math.Between(-200,200),20
        )

        if (stars.countActive(true) === 0){

            stars= this.physics.add.group({
                key: 'star',
                repeat: 20,
                setXY:{x:12, y:0, stepX: 70},
            });
            stars.children.iterate(function(child){
                // @ts-ignore
                child.setBounceY(Phaser.Math.FloatBetween(0.4, 0.8));
            })
            this.physics.add.overlap(
                player,
                stars,
                this.collectStar,
                null,
                this
            )




        }
    }

    // hitBombs(player, bomb){
    //     this.physics.pause()
    //     player.setTint(0xfff000)
    //     player.anims.play('turn')
    //     gameOver = true
    // }

    update(){
        keyA = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.A)
        keyD = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.D)
        keyS = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.S)
        keyW = this.input.keyboard.addKey(Phaser.Input.Keyboard.KeyCodes.W)
        if(keyA.isDown){
            player.setVelocityX(-160)
            player.anims.play('left', true)
        }else if(keyD.isDown){
            player.setVelocityX(160)
            player.anims.play('right', true)
        }else if(keyW.isDown){
            player.setVelocityY(-250)
        }else{
            player.setVelocityX(0)
            player.anims.play('turn')
        }
    }
}
